import React, {useState, useEffect} from 'react';
import { useParams } from 'react-router-dom';
import './CartPage.css';
import { useContext } from 'react';
import { UserContext } from '../App.js';

const productPage = (productID) => {
    window.location.href = `/product/${productID}`;
};

const roundedQuantity = (quantity) => {
    return parseFloat(quantity.toFixed(2));
} 

const CartPage = () => {
    // { cart, updateProductQuantity, removeFromCart, clearCart }
    const [products, setProducts] = useState([]);
    const [loading, setLoading] = useState(true);
    const { user } = useContext(UserContext);

    const grandTotal = cart.reduce((acc, product) => acc + product.price * product.quantity, 0);

    // const updateQuantity = async (productID, newQuantity) => {
    //     if (newQuantity >= 1) {
    //       await updateProductQuantity(productID, newQuantity);
    //     }
    // };


    const [cart, setCart] = useState([]);
    //const { user } = useContext(UserContext);

    useEffect(() => {
      fetch(`http://localhost:8080/v1/carts/customer/${user.id}`)
        .then(response => response.json())
        .then(data => setCart(data.contents))
        .catch(error => console.error('Error fetching cart:', error));
    }, [user.id]);

    const addItemToCart = (iteminfo) => {
      fetch('http://localhost:8080/v1/carts/add', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(iteminfo),
      })
      .then(response => response.json())
      .then(data => {
